import './BatsmenBox.css'
import BatsmenItem from './BatsmenItem';

function BatsmenBox(props) {

    return (
        <div className="batsmen_box">
            <BatsmenItem name="Kohli" runs="73*" balls ="45"/>
            <BatsmenItem name="Pant" runs="61" balls ="38"/>
            <BatsmenItem name="Pandya" runs="38" balls ="21"/>
            <BatsmenItem name="Rohit" runs="20" balls ="18"/>
            <div className='empty'>
            </div>
        </div>
    )

    }
export default BatsmenBox;
